{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/cemprondanziel/google-data-analytics-case-study-1-cyclistic?scriptVersionId=135251612\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"843a8c3d","metadata":{"papermill":{"duration":0.025146,"end_time":"2023-06-29T13:55:20.336831","exception":false,"start_time":"2023-06-29T13:55:20.311685","status":"completed"},"tags":[]},"source":["# Case Study: How Does a Bike-Share Navigate Speedy Success?\n","\n","\n","### March 17, 2023\n","\n","\n","# About the Company\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic\n","program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","\n","# ASK\n","\n","## Identifying the Problem:\n","#### How do annual members and casual riders use Cyclistic bikes differently?\n","\n","## Key Stakeholders:\n","1. Lily Moreno - The Director of Marketing\n","2. Cyclistic Marketing Analytics Team - Team of Data Analysts\n","3. Cyclistic Executive Team - Detail-oriented Executive Team\n","\n","## Business Task:\n","#### Analyze Cyclistic's historical bike trip data to\n","#### 1. Determine the differences between Cyclistic's Annual and Casual riders.\n","#### 2. Identify Trends."]},{"cell_type":"markdown","id":"5b15d240","metadata":{"papermill":{"duration":0.020156,"end_time":"2023-06-29T13:55:20.379398","exception":false,"start_time":"2023-06-29T13:55:20.359242","status":"completed"},"tags":[]},"source":["# PREPARE\n","\n","## Data Sources\n","User data from the past 12 months, March 2023 - February 2023 has been made available. Each data set is in csv format and details of every ride logged by Cyclistic customers. This data has been made publicly available via [license](https://ride.divvybikes.com/data-license-agreement) by Motivate International Inc. and the city of Chicago available [here](https://divvy-tripdata.s3.amazonaws.com/index.html). All user’s personal data has been scrubbed for privacy.\n","\n","## Data Credibility\n","The Data collected is Accurate and Credible as it represents only those who are Cyclistic's customers."]},{"cell_type":"markdown","id":"7ecd9a6a","metadata":{"papermill":{"duration":0.020185,"end_time":"2023-06-29T13:55:20.420024","exception":false,"start_time":"2023-06-29T13:55:20.399839","status":"completed"},"tags":[]},"source":["### Loading the libraries\n","Loading all the necessary libraries that will be utilized for the project"]},{"cell_type":"code","execution_count":1,"id":"5727a867","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2023-06-29T13:55:20.464577Z","iopub.status.busy":"2023-06-29T13:55:20.462439Z","iopub.status.idle":"2023-06-29T13:55:21.637458Z","shell.execute_reply":"2023-06-29T13:55:21.635732Z"},"papermill":{"duration":1.199682,"end_time":"2023-06-29T13:55:21.639998","exception":false,"start_time":"2023-06-29T13:55:20.440316","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]}],"source":["# Loading libraries\n","library(tidyverse)\n","library(lubridate)\n","library(janitor)\n","library(dplyr)\n","library(ggplot2)"]},{"cell_type":"markdown","id":"c6a0b5f8","metadata":{"papermill":{"duration":0.021015,"end_time":"2023-06-29T13:55:21.682372","exception":false,"start_time":"2023-06-29T13:55:21.661357","status":"completed"},"tags":[]},"source":["### Loading all the data\n","Loading all the data from the past 12 months, extracted from the website and stored in Kaggle."]},{"cell_type":"code","execution_count":2,"id":"86dd6356","metadata":{"execution":{"iopub.execute_input":"2023-06-29T13:55:21.759567Z","iopub.status.busy":"2023-06-29T13:55:21.727289Z","iopub.status.idle":"2023-06-29T13:57:00.838998Z","shell.execute_reply":"2023-06-29T13:57:00.837028Z"},"papermill":{"duration":99.138911,"end_time":"2023-06-29T13:57:00.842603","exception":false,"start_time":"2023-06-29T13:55:21.703692","status":"completed"},"tags":[]},"outputs":[],"source":["# Loads data into R\n","Mar_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202203.csv\")\n","Apr_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202204.csv\")\n","May_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202205.csv\")\n","Jun_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202206.csv\")\n","Jul_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202207.csv\")\n","Aug_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202208.csv\")\n","Sep_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202209.csv\")\n","Oct_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202210.csv\")\n","Nov_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202211.csv\")\n","Dec_2022 <- read.csv(\"/kaggle/input/divvy-tripdata/202212.csv\")\n","Jan_2023 <- read.csv(\"/kaggle/input/divvy-tripdata/202301.csv\")\n","Feb_2023 <- read.csv(\"/kaggle/input/divvy-tripdata/202302.csv\")"]},{"cell_type":"markdown"