_text(size = 20)) +\n","        labs(title=\"Rides per Month\",\n","            caption=paste0(\"Data from: \", mindate, \" to \", maxdate),\n","            x = \"Months\",\n","            y = \"Total Number of Rides\",\n","            color = \"Customer Type\")"]},{"cell_type":"markdown","id":"c7b94d7f","metadata":{"papermill":{"duration":0.042115,"end_time":"2023-06-29T13:58:50.816617","exception":false,"start_time":"2023-06-29T13:58:50.774502","status":"completed"},"tags":[]},"source":["### The rides per month show that casual riders were a lot more active during the summer months than the long-term. Conversely, the winter months show very little activity on the part of the casual users. The long-term users are more active in the winter and spring months."]},{"cell_type":"markdown","id":"35d9451f","metadata":{"papermill":{"duration":0.041428,"end_time":"2023-06-29T13:58:50.899498","exception":false,"start_time":"2023-06-29T13:58:50.85807","status":"completed"},"tags":[]},"source":["***\n","### Additional [Visual(s)](https://public.tableau.com/app/profile/danziel.cempron/viz/GoogleDataAnalyticsCaseStudy1-Cyclistic/Sheet1) for looking at the geospatial data\n","Using the starting latitude and starting longitude, we can create a chart in Tableau with these two geospatial data by simply placing the start_lat in the columns field and start_lng in the rows field.\n","\n","![Start Routes Downtown Chicago](https://drive.google.com/uc?export=view&id=1trWiP9iHSbhwoWUWRVufq8QrMH2SCzdi)\n","\n","![Downtown Chicago Bike Routes](https://drive.google.com/uc?export=view&id=1GWwZm82DQ1CgXvzY5hKT_AqhtpNyIwRy)"]},{"cell_type":"markdown","id":"55e48ff8","metadata":{"papermill":{"duration":0.041661,"end_time":"2023-06-29T13:58:50.98283","exception":false,"start_time":"2023-06-29T13:58:50.941169","status":"completed"},"tags":[]},"source":["### Looking at the Maps, we can see that Casuals mostly flocks around the downtown area and near the bay area which is where most of the landmarks and tourist spots are located at. The second image was lifted from Google Maps, the green lines shows Bike Routes or Roads that are bike friendly."]},{"cell_type":"markdown","id":"57c81833","metadata":{"papermill":{"duration":0.041068,"end_time":"2023-06-29T13:58:51.066312","exception":false,"start_time":"2023-06-29T13:58:51.025244","status":"completed"},"tags":[]},"source":["***\n","# ACT"]},{"cell_type":"markdown","id":"ff56f809","metadata":{"papermill":{"duration":0.040757,"end_time":"2023-06-29T13:58:51.147947","exception":false,"start_time":"2023-06-29T13:58:51.10719","status":"completed"},"tags":[]},"source":["## Limitations\n","\n","Data that could've improved and given more insights to the Analysis:\n","1. Costs of Cyclistic Programs - This would've given more context to the Analysis from the start. Without a proper cost struture, it is hard to quantify the cost of the two membership types.\n","2. Income Level - Providing this data would've given more insights as to what is affordable to the average Casual Rider."]},{"cell_type":"markdown","id":"2cf6c14f","metadata":{"papermill":{"duration":0.040445,"end_time":"2023-06-29T13:58:51.22886","exception":false,"start_time":"2023-06-29T13:58:51.188415","status":"completed"},"tags":[]},"source":["## Insights from the Analysis focusing on Casual Riders\n","\n","#### - Electric Bike Preference\n","#### - Spends significantly more time Riding\n","#### - Ridership Peaking on Late Afternoon to Evening\n","#### - Ridership Peaking on Weekends\n","#### - Ridership Peaking on Summer Months\n","#### - Concentrated in Downtown Chicago"]},{"cell_type":"markdown","id":"3d7e495b","metadata":{"papermill":{"duration":0.042393,"end_time":"2023-06-29T13:58:51.311838","exception":false,"start_time":"2023-06-29T13:58:51.269445","status":"completed"},"tags":[]},"source":["## Top Three Recommendations\n","\n","#### How Does a Bike-Share Navigate Speedy Success?\n","\n","### 1. Discount Offering for Casuals with long Ride Hours.\n","##### Casual Riders on average spends more than 20 hours using the Bicycles. As they are already aware of the program, offering them discounts could convince them to become an Annual Member.\n","\n","### 2. Exclusive Annual Summer Cycling Activities\n","##### Casual Riders peak during the Summer Months. Which could mean that Casual Members are available to activities during these months. Creating Exclusive Annual Cycling Events could help attract Casual Members into becoming Annual Members.\n","\n","### 3. Weekend Promotions in Downtown Chicago.\n","##### Casual Riders tend to be more concentrated in downtown Chicago. Targeted Marketing campaigns promoting Weekend ridership in this area could potentially attract Casual Rider to be an Annual Member."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":214.667174,"end_time":"2023-06-29T13:58:51.677464","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-06-29T13:55:17.01029","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}